import { Container } from "@mui/material";
import Grid2 from "@mui/material/Unstable_Grid2/Grid2";
import { useNavigate} from "react-router-dom";

const Home=()=>{
    useEffect(() => {
        let flag = localStorage.getItem("isLogin");
        if (flag === "false") {
          navigate("/Login");
        }
      });
    return (
        <Container>
            <Grid2>
                Welcome 
            </Grid2>
        </Container>
    )
}

export default Home;
